sys_variable_value.value:
(function execute(inputs, outputs) {
 if (inputs.status_code == 200){
    var results = JSON.parse(inputs.response_body).d.results;

    outputs.message = 'test...';
  } else {
	outputs.error_code = inputs.error_code;
    outputs.message = inputs.error_message;
  }
  outputs.status_code = inputs.status_code;
})(inputs, outputs);

